import React from "react";

function SaveBtn() {
  return <button style={{
    backgroundColor: "tomato",
    color: "white",
    border: none,
  }}>Save</button>
}

function ConfirmBtn() {
  return <button>Confirm</button>
}

function Buttons() {
  return (
    <div>
      <h1>Buttons</h1>
      <SaveBtn />
      <ConfirmBtn />
    </div>
  );
}

export default Buttons;
